import './LoginComponent.css';

import { Link } from 'react-router-dom';

export default function LoginComponent(){
    return(
        <div className="container-fluid login-component-parent-wrapper py-4">
            <div className="container login-component-child-wrapper py-3">
                <div className="login-component-content-wrapper">
                    <div className="row login-component-login-wrapper bg-white shadow-lg rounded py-5 text-center">
                        <div className="col-12 col-sm-12 col-md-6">
                            <h2 className="login-component-main-heading">
                                Login
                            </h2>
                            <p className="login-component-description mt-4">
                                Don't Have An Account ? &nbsp;
                                <Link to='/' className='register-right-component-link'>
                                    Register
                                </Link>
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
